import React from 'react';

import './index.css';
import { Route,  Routes } from 'react-router-dom';
import Home from './Pages/Home';
import Hero from '..//Hero';
function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/home" element={<Hero />} />
    </Routes>
  );
}

export default App;
